import * as React from 'react';
import { SVGIcon } from '../SVGIcon';
export const SquareFullIconConfig = {
  name: 'SquareFullIcon',
  height: 512,
  width: 512,
  svgPath: 'M512 512H0V0h512v512z',
  yOffset: 0,
  xOffset: 0,
  transform: ''
};
export const SquareFullIcon = props => {
  const newProps = Object.assign({
    config: SquareFullIconConfig
  }, props);
  return React.createElement(SVGIcon, newProps);
};
export default SquareFullIcon;
